import React from 'react';
import './styles.css';

const Home: React.FC = () => {
    return (
      <div className="home-container">
          <p>
            <h1> <span> FT_TRANSCENDENCE </span> </h1>
          </p>
        <div className="button-container">
        <RouterLink><button className="button-52" role="button">42_Login</button></RouterLink>
        <button className="button-52" role="button">Sign_In</button>
        <button className="button-52" role="button">Sign_Up</button>
        </div>
      </div>
    );
}

export default Home;
